currentQuery.query:
mutation ($ccc: String, $taxYr: Int, $taxMth: Int) {
  spRptEmpMonthSummary(input: {iCubitCompanyCode: $ccc, iTaxYear: $taxYr, iTaxMonth: $taxMth}) {
    tyRptEmpMonthSummaries {
      name
      employeeId
      employeeCode
      payBank
    }
  }
}

